■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>原木栽培の完熟霊芝だけを使用!!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5428/1071316-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="600" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5428/1071316-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="600" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5428/1071316-03.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="600" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5428/1071316-04.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">霊芝はサルノコシカケ科に属するキノコの一種で「万年茸」の名で親しまれ、中国では二千年以上も前から仙草の一つとして珍重されています。本製品は良質の霊芝、天然カルシウム、ビタミンC、天然ビタミンEを含有。もちろん、食べ易さと保存性も考慮して製造しております♪</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">(6粒当1.5g当たり)熱量 6 kcal、たんぱく質 0.05 g、脂質 0.12 g、炭水化物 0.94 g、ナトリウム 0.16 mg、霊芝エキス末 240 mg、ビタミンE 15 mg、ビタミンC 96 mg、カルシウム 90 mg、マグネシウム 45 mg</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">名称：霊芝加工食品<br>霊芝子実体抽出物、ドロマイト、デンプン、還元麦芽糖水飴、乳糖、抽出ビタミンE、ビタミンC、セルロース、ショ糖脂肪酸エステル、セラック</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><!--アレルギー表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr><td align="center" bgcolor="#FFFFCC" colspan="27"><font color="#333333" size="-1">アレルギー表示（原材料の一部に以下を含んでいます）</font></td></tr><tr><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">卵</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">乳</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">小麦</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">そば</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">落花生</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">えび</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">かに</font></td></tr><tr bgcolor="#FFFFFF"><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">●</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td></tr></table><br><!--アレルギー表ここまで--><!--その他アレルギーここから--><!--保存方法と製造（販売）者情報ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">保存方法</font></td><td width="75%"><font color="#333333" size="-1">直射日光や高温多湿を避けて保存してください。</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造（販売）者情報</font></td><td width="75%"><font color="#333333" size="-1">【製造・販売者】<br>フジワラ化学株式会社<br>愛媛県西条市大新田94</font></td></tr></table><br><!--保存方法と製造（販売）者情報ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">霊芝はサルノコシカケ科に属するキノコの一種で「万年茸」の名で親しまれ、中国では二千年以上も前から仙草の一つとして珍重されています。本製品は良質の霊芝、天然カルシウム、ビタミンC、天然ビタミンEを含有。もちろん、食べ易さと保存性も考慮して製造しております♪</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">商品区分</font></td><td width="75%" align="left"><font color="#333333" size="-1">健康食品</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">250mg×180粒</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：5×6×8cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：158g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">賞味期間：製造日より360日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
